import React from 'react';
import Logo from '../../assets/img/Logo.png';
import './menu.css';

function Menu(){
    return (
        <nav className>
        <img class = "Logo" src={Logo} alt="kemiflix logo"/>
        </nav>
    );
}

export default Menu;
